import React from 'react';

const Reminders = (props) => {
    return(
        <>
            <div className="reminder_list">
            <i class="fa fa-items" aria-hidden="true" />
                <li> {props.text}</li>
            </div>
         
        </>
    ); 
};

export default Reminders;
